import React from 'react';
import { Routes, Route} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import './main.css';
import Header from './components/Header';
import Map from './components/Map';
import Dashboard from './components/dashboard'
import Login from './components/Login'
import FleetManager from './components/Dashboard/FleetManager'
import Orders from './components/Dashboard/Orders'
import Customers from './components/Dashboard/Customers'
import EmpOrders from './components/Dashboard/EmpOrders';
import StaffLogin from './components/StaffLogin';

function App() {

  return (
    <>
    {/* <Login /> */}
    <div className="App">

      <Routes>
      <Route exact path="/" element={<StaffLogin/>}/>
      <Route exact path="/FleetManager" element={<FleetManager/>}/>
      <Route exact path="/Orders" element={<Orders/>}/>
      <Route exact path="/Customers" element={<Customers/>}/>
      <Route exact path="/EmpOrders" element={<EmpOrders/>}/>
      </Routes>
      {/* <Dashboard /> */}

      {/* <Map /> */}
    </div>
    </>
  );
}

export default App;
